var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作.。 \n \n Picture \n \n [It is my favorite photo] \n \n 自評與互評 \n', 'tags': '', 'url': 'About.html'}, {'title': 'W1', 'text': '*使用 cmsimde 建立靜態網誌: \n 1. 在 github 建立倉儲[CAD2020]，在git clone 到近端 \n 2. 之後再加入除了 cmsimde 目錄外的所有內容以 git submodule add (如老師筆記所記)，建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在使用python wsgi.py 啟動動態網站進行編輯，動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n \n *進行分工畫圖 \n', 'tags': '', 'url': 'W1.html'}, {'title': '零件體積表', 'text': '\n', 'tags': '', 'url': '零件體積表.html'}, {'title': 'HW1', 'text': 'inventor \n 畫圖者:40723135 \n 軟體版本:invent20 \n 所畫的零件為:PDF_1 \n 件50 \n \n \n 件49 \n \n \n 件48 \n \n \n 件47 \n \n \n 件46 \n \n \n 件45 \n \n \n 件44 \n \n \n 件43 \n \n \n 件42 \n \n \n 件41 \n \n \n 件40 \n \n \n 件39 \n \n \n 件38 \n \n \n 件37 \n \n \n 件36 \n \n \n 畫圖者:40823206 \n 軟體版本: \n 所畫的零件為:PDF_1 \n 件01 \n \n \n 件02 \n \n \n 件03 \n \n \n 件04 \n \n \n 件05 \n \n \n 件06 \n \n \n 件07 \n \n \n 件08 \n \n \n 件09 \n \n \n 件10 \n \n \n 件11 \n \n \n 件12 \n \n \n 件013 \n \n \n 件14 \n \n \n 件15 \n \n \n 件16 \n \n \n 件17 \n \n \n 件18 \n \n \n 件19 \n \n \n 件20 \n \n \n 件21 \n \n \n 件22 \n \n \n 件23 \n \n \n 件24 \n \n \n 件25 \n \n \n 畫圖者:40823217 \n 軟體版本:inventer2020 \n 所畫的零件為:PDF_1 \n 件26 \n \n \n 件27 \n \n \n 件28 \n \n \n 件29 \n \n \n 件30 \n \n \n \n \n', 'tags': '', 'url': 'HW1.html'}, {'title': 'w2~3', 'text': '+add ssh並拍影片 \n 零件繪製、表格製作、下載nx可攜版 \n \n', 'tags': '', 'url': 'w2~3.html'}, {'title': 'W4~6', 'text': '', 'tags': '', 'url': 'W4~6.html'}, {'title': 'HW2', 'text': '\n \n', 'tags': '', 'url': 'HW2.html'}, {'title': '筆記', 'text': '', 'tags': '', 'url': '筆記.html'}, {'title': '製作表格', 'text': '(此法也是學習於別人，若有錯誤請糾正!) \n \n 1.搜尋[試算表]，並點選第一個 \n \n \n 2.選個人，點前往google試算表 \n \n \n 3.點選右下的[建立新試算表] \n \n \n 4.當資料都輸入完時，找到[檔案]，往下看看到[發佈到網路] \n \n \n 5.選到[內嵌]，記得選擇[工作表1]，然後[複製原始碼] \n \n \n 6.接著到動態網站，到一個你要放表格的地方，然後進行編輯，之後找到[source code]點入 \n \n \n 7.將剛剛那段[原始碼]貼入即可。 \n \n \n 希望有幫助到你(讚) \n \n', 'tags': '', 'url': '製作表格.html'}, {'title': '如何使用ssh', 'text': '目的:利用ssh來commit資料 \n \n', 'tags': '', 'url': '如何使用ssh.html'}, {'title': '1.PART', 'text': '\n 首先要製作金鑰來做為驅動ssh的關鍵 \n 1.點選資料夾中 Portablegit →bin→sh.exe(之前有下載過的，如沒有請觀看老師的影片) \n 就會出現黑窗 \n \n 輸入ssh-keygen -t rsa -b 4096 -C "40823217"(學號處請自行修改) \n 按enter →輸入/y/tmp/id_rsa→按2次enter \n \n (在第3行應該會出現"y/tmp/id_rsa"這部分，之後再確認一下東西放哪就行) \n \n 2.開啟白窗，將"start.bat"移入，並加上這兩行文字 \n \n \n set GIT_HOME=%Disk%:\\Portablegit\\bin\\\nset GIT_SSH=%Disk%:\\putty\\plink.exe\n \n (加入路徑的意思) \n \n \n 3.點選資料夾"cad2020"→找到git→將config移入白窗 \n (如若找不到，請點選檔案那行→找到檢視→在右邊找到"副檔名"這個選項，並打勾即可) \n \n \n 新增[remote "origin"]裡的url =  git@github.com:40823217/cad2020.git \n ("#"記得加上) \n 之後將其save \n \n \n 第一部分完成，如有問題歡迎糾正 \n 第二部分前請先下載" putty 、 putty_home 、 GitExtensions " \n \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': '1.PART.html'}, {'title': '2.PART', 'text': '\n 第二部分前，請確認這三個資料夾是否都在，再進行操作 \n \n \n 1.找到"putty"並 打開資料夾的中"puttygen.exe" \n \n \n 點選load，找到id_rsa(若找不到請到右下角選擇"所有檔案"即可) \n \n \n 按"是"→Save private key→按"是" →輸入學號(存成.ppk檔) \n \n 2.打開資料夾中的"putty.exe" \n (裡面若沒有存在"github.com"，在[Host Name]和[Save Sessions]打" github.com"按Save) \n \n \n 設定proxy(如使用自家網路或手機網路請選"None"這個選項) \n 下面那行是看你的網路連到哪一台主機 就打一樣的proxy進去 \n (我的是自家網路所以選擇"none") \n \n \n 打開SSH裡面的"Auth" \n 選擇你所存下金鑰檔案(.ppk) \n \n 回到session(滑到最上面那個)點選save再open \n (成功就會出現下面這個) \n \n \n 3. 在home裡面新增[.ssh資料夾] \n \n \n ProxyCommand y:/putty/plink.exe github.com %h %p\n  \nHost github.com\n    User git\n    Port 22\n    Hostname github.com\n  \n    TCPKeepAlive yes\n    IdentitiesOnly yes \n 將上面的指令複製到白窗並另存一個"config"進去資料夾 \n \n 4.在倉儲上新增一個金鑰 \n 去到倉儲網頁，在右上角的頭像旁邊有個箭頭點開，在下方找到"Settings" \n 再從旁邊的目錄找到"SSH and GPG keys" \n \n \n 點New SSH key \n \n 到"tmp"找到"id_rsa.pub"並移到白窗中打開，複製裡面內容到Key來 \n {並確認自己學號} \n 按Add SSH key \n \n \n 第二部分完成，再來就是要進行如何上傳的部分了 \n \n', 'tags': '', 'url': '2.PART.html'}, {'title': '3.PART', 'text': '\n 如何上傳 \n 一:若完成第一部分跟第二部分的 \n 直接進行"git add ." →"git commit -m "此更新的主旨"→"git push" \n (此方法就不需打在打帳號密碼了) \n \n 二:使用"GitExtensions" \n 步驟如下→ \n 1. 點選[ GitExtensions]中的" GitExtensions.exe" \n \n \n 然後修改裡面的設定 \n \n \n 確認正確以後\xa0 \xa0點選"OK" \n \n 2.選擇"Create new repository"→點"Browse"→選自己的資料夾 \n 然後create \n \n \n 點擊"tools"→"Git GUI" \n \n \n 先點選"Stage Changed"(等同於"git add ."的功能) \n \n \n 按是→按Continue(通常再按完"是"後會出現) \n \n \n 然後右下的位置打上這次的主旨(等於 git commit -m "此更新的主旨" ) \n 然後就點擊Commit→Push →Push \n \n \n \n \n 成功!! \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': '3.PART.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n \n', 'tags': '', 'url': 'Develop.html'}, {'title': '第三組名單', 'text': 'site: 40823201 \n site: 40823203 \n site: 40823205 \n site: 40823206 \n site: 40823210 \n site:40823227(404) \n site: 40823248 \n site:40723135(404) \n site:40723215(404) \n \n', 'tags': '', 'url': '第三組名單.html'}]};